#include <ctime>
#include <iostream>
#include <string>
#include <vector>

using namespace std;

class Solution {
public:
    void solve(vector<vector<char>>& a) {
        if (a.empty()) return;
        int n = a.size(), m = a[0].size();
        if (n < 3 || m < 3) return;
        vector<bool> v(n*m);
        for (int i = 1; i < n-1; ++i) {
            auto &row = a[i];
            for (int j = 1, k = i*m; j < m-1; ++j, ++k) {
                if (row[j] == 'X' || v[k]) continue;
                vector<int> q;
                if (visit(n, m, i, j, a, v, q))
                    update(m, a, q);
            }
        }
    }

    bool visit(int n, int m, int i, int j,
            vector<vector<char>> &a, vector<bool> &v, vector<int> &q) {
        bool out = false;
        vector<int> u;
        u.push_back(i*m+j);
        while (!u.empty()) {
            i = u.back()/m;
            j = u.back()%m;
            u.pop_back();
            if (a[i][j] == 'X' || v[i*m+j]) continue;
            q.push_back(i*m+j);
            v[i*m+j] = true;
            out |= i==0 || i==n-1 || j==0 || j==m-1;
            if (i > 0 && !v[(i-1)*m+j]) u.push_back((i-1)*m+j);
            if (i < n-1 && !v[(i+1)*m+j]) u.push_back((i+1)*m+j);
            if (j > 0 && !v[i*m+j-1]) u.push_back(i*m+j-1);
            if (j < m-1 && !v[i*m+j+1]) u.push_back(i*m+j+1);
        }
        return !out;
    }

    void update(int m, vector<vector<char>> &a, vector<int> &q) {
        while (!q.empty()) {
            int i = q.back() / m, j = q.back() % m;
            q.pop_back();
            a[i][j] = 'X';
        }
    }
};

